import React, {useState} from 'react';
import { Dialog, DialogTitle, DialogContent, TextField } from '@material-ui/core';

const Modal = props => {

	const [search, setSearch] = useState({
		buscar: "",
		resultados: []
	});

	return (
		<Dialog onClose={() => props.setDialog(false)} open={props.dialog}>
	      <DialogTitle>
	      	Agregar Nueva Ubicacion
	      </DialogTitle>
	      <DialogContent dividers>
	       
	       <TextField id="standard-basic" label="Buscador..." />

	       { search.resultados.map( resultado => (
	       		<p>hola</p>
	       ))}

	      </DialogContent>
	    </Dialog>
	);
}

export default Modal;
